import {Container, Row, Col} from 'react-bootstrap';

const Header = () => {
    return (
        <>
            <Container>
                <Row>
                    <Col xs={10} sm={10} md={10} lg={8} xl={8}>
                        Where in the world?

                    </Col>
                    <Col xs={2} sm={2} md={2} lg={4} xl={4}>
                        Light/Dark
                    </Col>
                </Row>
            </Container>
        </>
    )
}

export default Header;
